import Note from "./Note"

const notes = ({notes}) => {
  let columnId = 0

    return (
      <>
        {columnId % 16 === 0 ?
          <>
            notes.map((note) => (
              <Note note={note} columnId={columnId +=1}/>
            ))
          </>
        : notes.map((note) => (
          <>
            {columnId +=1}
            <p>test</p>
            <Note note={note} columnId={columnId+=1}/>
          </>
          ))
        }
      </>
    )
}

export default notes
